  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Blackwater
  National Wildlife Refuge outlines Refuge accomplishments during the 1983 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  management planning, compliance with environmental and cultural resource mandates,
  and research and investigations. Refuge administration is outlined; information
  about personnel, youth programs, funding, safety, and technical assistance is given.
  Habitat management is also covered; subjects include wetlands, forests, croplands,
  fire management, and pest control. The wildlife section of the report discusses
  endangered and threatened species, migratory birds, game mammals, animal control,
  marking and bird banding, and disease control. The public uses of the Refuge described
  in this report include information and interpretation, outdoor classrooms, recreational
  uses, and law enforcement. The equipment and facilities section of the report provides
  information about major maintenance, equipment replacement, communication systems,
  and energy conservation. Cooperative programs and items of interest are provided
  at the end. Photographs and brief narrative reports for Glen L. Martin National
  Wildlife Refuge and Susquehanna National Wildlife Refuge are attached.\",\n\t\"owner_org\":
